$(document).ready(function () {
  $('.burger-catalog').hide(0)
  $('.mob-open').click(function () {
    bodyScrollLock.disableBodyScroll(document.querySelector('.m-menu'));
    $('.m-menu').addClass('active')
    $('.m-menu__bg').addClass('active')
    $('.m-menu__burger').addClass('active')
  })
  $('.burger__close, .m-menu__bg').click(function () {
    bodyScrollLock.enableBodyScroll(document.querySelector('.m-menu'));
    $('.m-menu').removeClass('active')
    $('.m-menu__bg').removeClass('active')
    $('.m-menu__burger').removeClass('active')
  })
  $('.mob-catalog').click(function () {
    $('.burger-catalog').animate({
      height: "toggle",
      opacity: "toggle"
    }, 300);
  })
})

$('.show-sales').click(function () {
  $('.sales-history').addClass('visible');
  $('.sales-history__wrap').addClass('visible');
});
