function showMessage(type, msg) {
  if (type == 'success') {
    $('.popover_success').html(msg);
    $('.ib-popover--success').addClassAndRemove('show', 200, 4000);
  } else {
    $('.popover_error').html(msg);
    $('.ib-popover--error').addClassAndRemove('show', 200, 4000);
  }
}
