function toggleEditForm(id) {
  $('#divInfo' + id).addClass('hidden');
  $('#FrmEdit' + id).removeClass('hidden');
  $('#edit_btn_' + id).addClass('hidden');
  $('#save_btn_' + id).removeClass('hidden');
}
function removeWatch(w_id) {
  if (confirm('Are you sure you want to delete this watch ?')) {
    $.ajax({
      url: '/admin/json/delete-watch',
      type: 'POST',
      data: { id: w_id },
      success: function (data) {
        var r = $.parseJSON(data);
        if (r.error) {
          showMessage('error', r.msg);
        } else {
          showMessage('success', r.msg);
          $('#watch_container_' + w_id).remove();
        }
      }
    })
  }
}

function addToPopular(id) {
  block();
  $.ajax({
    url: '/admin/json/add-to-popular/' + id,
    type: 'GET',
    success: function (data) {
      unblock();
      var r = $.parseJSON(data);
      if (!r.error) {
        $('#fav_link_' + id).find('svg').addClass('active');
        $('#fav_link_' + id).attr('onclick', 'removeFromPopular(' + id + ');');
      } else {
        showMessage('error', r.msg);
      }

    }
  })
}

function removeFromPopular(id) {
  block();
  $.ajax({
    url: '/admin/json/remove-from-popular/' + id,
    type: 'GET',
    success: function (data) {
      unblock();
      var r = $.parseJSON(data);
      if (!r.error) {
        $('#fav_link_' + id).find('svg').removeClass('active');
        $('#fav_link_' + id).attr('onclick', 'addToPopular(' + id + ');');
        $('#popular_slide_' + id).remove();
      } else {
        showMessage('error', r.msg);
      }

    }
  })
}

function saveEditForm(id) {
  block();
  var formData = new FormData($('#FrmEdit' + id)[0]);// yourForm: form selector        
  $.ajax({
    type: "POST",
    url: "/json/quick-edit",
    data: formData,
    processData: false,
    contentType: false,
    success: function (data) {
      unblock();
      var r = $.parseJSON(data);
      if (!r.error) {
        showMessage('success', r.msg);
        $("#divInfo" + id).empty();
        $('#divInfo' + id).html(r.html);
        $('#divInfo' + id).removeClass('hidden');
        $('#FrmEdit' + id).addClass('hidden');
        $('#edit_btn_' + id).removeClass('hidden');
        $('#save_btn_' + id).addClass('hidden');
      } else {
        showMessage('error', r.msg);
      }
    }
  });

}

