$('.serial_btn').click(function (e) {
  var val = $('#serial_keyword').val().toLowerCase();
  if (val != '') {
    var firstchar = val.charAt(0);

    switch (firstchar) {
      case 'd':
        $(this).parent('.search__form').find('.result__serial').html('D (XXXX) serial ');
        $(this).parent('.search__form').find('.result__model').html('2006 model!')
        $(this).parent('.search__form').find('.serial__result__container').addClass('done');
        $(this).parent('.search__form').find('.serial__got').addClass('done');
        $(this).parent('.search__form').find('.serial__result__container').removeClass('error');
        $(this).parent('.search__form').find('.serial__got').removeClass('error');
        break;

      case 'z':
        $(this).parent('.search__form').find('.result__serial').html('Z (XXXX) serial ');
        $(this).parent('.search__form').find('.result__model').html('2006 to 2008 model!');
        $(this).parent('.search__form').find('.serial__result__container').addClass('done');
        $(this).parent('.search__form').find('.serial__got').addClass('done');
        $(this).parent('.search__form').find('.serial__result__container').removeClass('error');
        $(this).parent('.search__form').find('.serial__got').removeClass('error');
        break;

      case 'm':
        $(this).parent('.search__form').find('.result__serial').html('M (XXXX) serial ');
        $(this).parent('.search__form').find('.result__model').html('2006 to 2008 model!')
        $(this).parent('.search__form').find('.serial__result__container').addClass('done');
        $(this).parent('.search__form').find('.serial__got').addClass('done');
        $(this).parent('.search__form').find('.serial__result__container').removeClass('error');
        $(this).parent('.search__form').find('.serial__got').removeClass('error');
        break;


      case 'v':
        var random = false;
        for (var i = 0; i < val.length; i++) {
          char = val.charAt(i);
          if (char == 'g') {
            random = true;
          }
        }

        if (random) {
          $(this).parent('.search__form').find('.result__serial').html('V (XXGXX) serial ');
          $(this).parent('.search__form').find('.result__model').html('RANDOM modell!');
          $(this).parent('.search__form').find('.serial__result__container').addClass('done');
          $(this).parent('.search__form').find('.serial__got').addClass('done');
          $(this).parent('.search__form').find('.serial__result__container').removeClass('error');
          $(this).parent('.search__form').find('.serial__got').removeClass('error');
        } else {
          $(this).parent('.search__form').find('.result__serial').html('V (XXXX) serial ');
          $(this).parent('.search__form').find('.result__model').html('2009 model!');
          $(this).parent('.search__form').find('.serial__result__container').addClass('done');
          $(this).parent('.search__form').find('.serial__got').addClass('done');
          $(this).parent('.search__form').find('.serial__result__container').removeClass('error');
          $(this).parent('.search__form').find('.serial__got').removeClass('error');
        }

        break;

      case 'g':
        $(this).parent('.search__form').find('.result__serial').html('G (XXXX) serial ');
        $(this).parent('.search__form').find('.result__model').html('2010 model!');
        $(this).parent('.search__form').find('.serial__result__container').addClass('done');
        $(this).parent('.search__form').find('.serial__got').addClass('done');
        $(this).parent('.search__form').find('.serial__result__container').removeClass('error');
        $(this).parent('.search__form').find('.serial__got').removeClass('error');
        break;

      default:
        $(this).parent('.search__form').find('.serial__result__container').removeClass('done');
        $(this).parent('.search__form').find('.serial__got').removeClass('done');
        $(this).parent('.search__form').find('.serial__result__container').addClass('error');
        $('.serial__got').hide();
        $('#unknown_serial').show();
        break;
    }

  } else {
    $(this).parent('.search__form').find('.serial__result__container').removeClass('done');
    $(this).parent('.search__form').find('.serial__got').removeClass('done');
    $(this).parent('.search__form').find('.serial__result__container').removeClass('error');
    $(this).parent('.search__form').find('.serial__got').removeClass('error');
    $('.serial__got').show();
    $('#unknown_serial').hide();
  }
});


