function addRedirect() {
  var link = prompt('Please enter the search keywords', '');
  if (link != '') {
    var origin_link = window.location.href;
    $.ajax({
      url: '/admin/json/new-redirect',
      type: 'POST',
      data: { origin: origin_link, to: link },
      success: function (data) {
        var r = $.parseJSON(data);
        if (!r.error) {
          showMessage('success', r.msg);
        } else {
          showMessage('error', r.msg);
        }
      }
    })
  } else {
    showMessage('error', 'Redirect link cannot be empty !');
  }
}

