$('.modal__field.sms').on('keyup', function (event) {
  var x = $(event.target);

  var key = event.which;
  if (key == 8 || key == 46) {
    console.log('backspace detected');
  } else {
    var ml = ~~x.attr('maxlength');
    if (ml && x.value.length >= ml) {
      do {
        x = x.nextSibling;
      }
      while (x && !(/text/.test(x.type)));
      if (x && /text/.test(x.type)) {
        if (x != undefined) {

          x.focus();
        }
      }
    }
  }

});
$('.testselect2').change(function () {
  buildTags();
});


function buildTags() {
  $('.tags__container').empty();
  $('.testselect2').each(function (index, obj) {
    var values = $(obj).val();
    var field = $(obj).data('name');
    var extra = $(obj).data('extra');
    $.each(values, function (index, val) {
      addTag(val, field, extra);
    });
  });

}

function addTag(text, field = '', extra = '') {
  var html = `<div class="tag__wrapper">
                    <input type="hidden" name="`+ field + `" value="` + text + `"/>
                    <div class="tag__name">`+ extra + `` + text + `</div>
                </div>`;
  $('.tags__container').append(html);
}
