function showVerificationModal() {
  signUpBegin.seek(0);
  signUpEndLog.seek(0);
  signUpEndFail.seek(0);
  $('.modal.register').css('display', 'none');
  $('.modal.login').css('display', 'none');
  $('.modal.verify').css('display', 'block');
  $('.modal__result.sms').addClass('active');
}

function showPhoneVerification() {
  $('.modal__result.sms').addClass('active');
  $('.modal.pwd').css('display', 'none');
  $('.modal.login').css('display', 'none');
  $('.modal.register').css('display', 'none');
  $('.modal.verify').css('display', 'block');
}

$('#loginFrm').submit(function (e) {
  e.preventDefault();
  var formData = new FormData(this);
  showProgress();
  $.ajax({
    url: '/json/authenticate',
    type: 'POST',
    data: formData,
    processData: false,
    contentType: false,
    success: function (data) {
      var r = $.parseJSON(data);
      if (!r.error) {
        signBegin.finished.then(showLoginSuccess);
      } else {
        signBegin.finished.then(showLoginError);
      }
    }
  });
});
$('#frmSignup').submit(function (e) {
  e.preventDefault();
  var formData = new FormData(this);
  showSignupProgress();
  $.ajax({
    url: '/json/signup',
    type: 'POST',
    data: formData,
    processData: false,
    contentType: false,
    success: function (data) {
      var r = $.parseJSON(data);
      $('.modal__result').text(r.msg);
      if (!r.error) {
        signUpBegin.finished.then(showSignupSuccess);
      } else {
        signUpBegin.finished.then(showSignupError);
      }
    }
  });
});

$('#frmSMS').submit(function (e) {
  e.preventDefault();
  var formData = new FormData(this);
  showSMSProgress();
  $.ajax({
    url: '/json/verify-sms',
    type: 'POST',
    data: formData,
    processData: false,
    contentType: false,
    success: function (data) {
      var r = $.parseJSON(data);
      $('#main_result').text(r.msg);
      if (!r.error) {
        smsBegin.finished.then(showSMSSuccess);
      } else {
        smsBegin.finished.then(showNewSMSError);
      }
    }
  });
});

$('#resetPwd').submit(function (e) {
  e.preventDefault();
  var formData = new FormData(this);
  showPwdResetProgress();
  $.ajax({
    url: '/json/reset-pwd',
    type: 'POST',
    data: formData,
    processData: false,
    contentType: false,
    success: function (data) {
      var r = $.parseJSON(data);
      $('.modal__result').text(r.msg);
      if (!r.error) {
        pwdResetBegin.finished.then(showPwdResetSuccess);
      } else {
        pwdResetBegin.finished.then(showPwdResetFailed);
      }
    }
  });
});

function hideMessages() {
  $('.sign-modal__error').removeClass('active');
  $('.sign-modal__success').removeClass('active');
}
function hideProgress() {
  $('.sign-modal__progress').removeClass('active');
}
function showProgress() {
  signEndLog.seek(0);
  signBegin.seek(0);
  signEndFail.seek(0);
  signBeginFail.seek(0);
  $('.sign-process').addClass('active');
  signBegin.play()

}
function showSMSProgress() {
  smsBegin.seek(0);
  smsEndLog.seek(0);
  smsVerificationFailed.seek(0);
  $('.sms-process').addClass('active');
  smsBegin.play();
}
function showPwdResetProgress() {
  pwdResetBegin.seek(0);
  pwdResetEndLog.seek(0);
  pwdResetEndFail.seek(0);
  $('.pwd-process').addClass('active');
  pwdResetBegin.play();
}
function showSignupProgress() {
  signUpBegin.seek(0);
  signUpEndLog.seek(0);
  signUpEndFail.seek(0);
  $('.signup-process').addClass('active');
  signUpBegin.play();
}
function showLoginSuccess() {
  signEndLog.play();
  $('.modal__result').text('Succesfully Logged In!');
  signEndLog.finished.then(redirectLogin);
}
function redirectLogin() {
  window.location.href = "/";
}
function showLoginError(msg) {
  signEndFail.play();
  $('.modal__result').text('Wrong Email or Password');
}
function showSignupSuccess() {
  signUpEndLog.play();
  signUpEndLog.finished.then(showVerificationModal);
}

function showSignupError() {
  signUpEndFail.play();
}

function showPwdResetSuccess() {
  pwdResetEndLog.play();
  pwdResetEndLog.finished.then(redirectLogin);
}

function showPwdResetFailed() {
  pwdResetEndFail.play();
}
function showSMSSuccess() {
  smsEndLog.play();
  //smsEndLog.finished.then(redirectLogin);
}

function showNewSMSError() {
  smsVerificationFailed.play();
}

function showPwdSuccess(msg = '') {
  $('.modal__result.success.pwd').addClass('active');
  $('.result__txt.success.pwd').addClass('active');
  $('.result__txt.success.pwd').html(msg);
  animationPwd.playSegments([0, 100], true);
}

function showPwdError(msg) {
  $('.modal__result.failed.pwd').addClass('active');
  $('.result__txt.failed.pwd').html(msg);
  $('.result__txt.failed.pwd').addClass('active');
  animationPwdFail.playSegments([0, 50], true);
  setTimeout(function () {
    $('.modal__result.failed.pwd').removeClass('active');
    $('.result__txt.failed.pwd').removeClass('active');
  }, 3000);
}

$('#accountFrm').submit(function (e) {
  e.preventDefault();
  showProgress();
  var form = new FormData(this);
  $.ajax({
    url: '/json/account/update/personal',
    type: 'POST',
    data: form,
    processData: false,
    contentType: false,
    success: function (data) {
      var r = $.parseJSON(data);
      hideProgress();
      if (!r.error) {
        showMessage('success', 'Your personal information were updated.');
      } else {
        showMessage('error', r.msg);
      }
    }
  })
  showMessage('success', 'Account form');
});


