$(document).ready(function () {
  /*Reverse all animation*/
  $(".theft-another").click(function () {
    $('.theft__result').removeClass('visible')
    $('.theft__form-wrap').removeClass('inactive')
    setTimeout(function () {
      theftProcess.seek(0);
      watchClean.seek(0);
      watchBad.seek(0);
    }, 500);
  });
  $('.theft-check.bad').click(function () {
    $('#theftCheckFrm').trigger('reset');
  });

  $(".theft-check.clean").click(function () {
    $('#submit_theft_check').click();

  });
});



function showTheftCheckProgress() {
  $('.theft__result').addClass('visible');
  $('.theft__form-wrap').addClass('inactive');
  theftProcess.play();
  setTimeout(function () {
    showResult();
  }, 8200);
}


function showResult() {
  if (!theft_check) {
    showClean();
  } else {
    showBad();
  }
}
function showClean() {
  watchClean.play();
  $('.result__text').text('This watch is considered clean');
}


function showBad() {
  watchBad.play();
  $('.result__text').text('This watch is considered bad');
}


$('#theftCheckFrm').submit(function (e) {
  showTheftCheckProgress();
  e.preventDefault();
  var formData = new FormData(this);
  $.ajax({
    url: '/json/theft-check',
    type: 'POST',
    data: formData,
    processData: false,
    contentType: false,
    success: function (data) {
      var r = $.parseJSON(data);
      theft_check = r.error;
    }
  });
});


