function nextField(e) {
  console.log(e);
  var x = $(e.target);
  var key = e.keyCode || e.charCode;
  if (key == 8 || key == 46) {
    console.log('backspace detected');
  } else {
    if (x != undefined) {
      var ml = ~~x.attr('maxlength');
      if (ml && x.value.length >= ml) {
        do {
          x = x.nextSibling;
        }
        while (x && !(/text/.test(x.type)));
        if (x && /text/.test(x.type)) {
          x.focus();
        }
      }
    }

  }



}

